import headerbg from "./headerbg.jpg";

let styles = {
    header: {
        backgroundImage:'url('+headerbg+')',
        width:'100%',
        height: '10%',
        minHeight: '6em',
        backgroundPositionX: 0,
        backgroundPositionY: 0,
    },
};

export default styles;
